import React, { Component} from 'react'
import ReactDOM from 'react-dom';
<RangeSlider
  componentId="RangeSliderSensor"
  dataField="guests"
  title="Guests"
  range={{
    "start": 0,
    "end": 10
  }}
  defaultValue={{
    "start": 1,
    "end": 5
  }}
  rangeLabels={{
    "start": "Start",
    "end": "End"
  }}
  stepValue={1}
  showHistogram={true}
  showFilter={true}
  interval={2}
  react={{
    and: ["CategoryFilter", "SearchFilter"]
  }}
  URLParams={false}
/>
